on Locked="false" Priority="32" SemiHidden="false"   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"></w:LsdException>  <w:LsdException Locked="false" Priority="33" SemiHidden="false"   UnhideWhenUsed="false" QFormat="true" Name="Book Title"></w:LsdException>  <w:LsdException Locked="false" Priority="37" Name="Bibliography"></w:LsdException>  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"></w:LsdException> </w:LatentStyles></xml><![endif]--><!--[if gte mso 10]><style> /* Style Definitions */ table.MsoNormalTable{mso-style-name:"Tableau Normal";mso-tstyle-rowband-size:0;mso-tstyle-colband-size:0;mso-style-noshow:yes;mso-style-priority:99;mso-style-parent:"";mso-padding-alt:0cm 5.4pt 0cm 5.4pt;mso-para-margin-top:0cm;mso-para-margin-right:0cm;mso-para-margin-bottom:3.0pt;mso-para-margin-left:0cm;text-align:justify;mso-pagination:widow-orphan;font-size:10.0pt;font-family:"Calibri","sans-serif";mso-fareast-language:EN-US;}</style><![endif]-->La FCBN développe un catalogue national qui correspond à l’inventaire des taxons de la flore vasculaire présents en France métropolitaine et à l’outre-mer sur la base du référentiel taxonomique et nomenclatural national (TAXREF). Pour chaque taxon,il capitalise des informations de niveau régional relatives à leurs statuts de présence, statuts réglementaires, fréquence, catégories de menaces, catégorie de risque invasif, traits biologiques, chorologie, etc., il restitue le même type d’informations pour le niveau national.</p><p align="left"><a href="https://www.youtube.com/watch?v=-NWMyzHkk-Q" style="text-align:left">Tutoriel vidéo n°3 - Rubrique "CATNAT" </a>(3min20)</p>', 0);
